void MMS_pressure_volume(double *P, double *V, HOMMAT const * hommat, double t, double X, double Y, double Z)
{
  double kappa = hommat->E/(3.0*(1.0-2.0*hommat->nu));
  double u_t = cos(M_PI*(1.0/4.0)-t*1.0E3)/(t*1.0E3+1.0)-sqrt(2.0)*(1.0/2.0);
  double DC = MMS_DC(t, X, Y, Z, u_t);
  double J = sqrt(DC);
  double dUdJ = 0.5*(exp(J-1) - 1.0/J);
  *P = dUdJ*kappa;
  *V = J;
}

